import React, {useEffect, useState} from 'react';
import Header from "./Header"; // Import the CSS file for styling
import { useNavigate } from "react-router-dom";
import MyCalendar from "../MyCalendar";
import './../style/MyCalendar.css'
import FullCalendar from "@fullcalendar/react";
import dayGridPlugin from "@fullcalendar/daygrid";
import interactionPlugin from "@fullcalendar/interaction";


const MyPage = () => {
    const navigate = useNavigate();

    useEffect( () => {
        console.log("storage :: " + localStorage.getItem('watched'))
    }, [])

    const [events, setEvents] = useState([
        { title: "Event 1", date: "2023-05-10" },
        { title: "Event 2", date: "2023-05-12" },
    ]);

    const handleDrop = (info) => {
        // 이벤트를 드롭한 후의 처리 로직을 구현합니다.
        // info.draggedEl에는 드래그한 이벤트 엘리먼트가 포함되어 있습니다.
        // info.date에는 드롭한 날짜가 포함되어 있습니다.

        // 이벤트를 업데이트하거나 서버로 이동하는 등의 작업을 수행할 수 있습니다.

        // 예시: 드롭한 이벤트의 ID를 출력합니다.
        console.log('Dropped event ID:', info.draggedEl.dataset.eventId);
    };

    return (
        <>
            <Header/>
            <div className='calendar-head' >
                <FullCalendar
                    plugins={[dayGridPlugin, interactionPlugin]}
                    initialView="dayGridMonth"
                    events={events}
                    editable={true}
                    droppable={true}
                    eventDrop={handleEventDrop}
                />
            </div>
        </>
    );
};

export default MyPage;
